virtualTable.sql:
SELECT public.catamidb_pose.deployment_id, 
public.catamidb_pose.position, 
public.catamidb_pose.depth, 
public.catamidb_image.id, 
public.catamidb_image.web_location, 
public.catamidb_image.archive_location, 
public.catamidb_deployment.start_time_stamp,
public.catamidb_deployment.end_time_stamp,
public.measurements_view.temperature,
public.measurements_view.salinity,
public.measurements_view.pitch,
public.measurements_view.roll,
public.measurements_view.yaw,
public.measurements_view.altitude
FROM public.catamidb_pose,public.catamidb_image,public.measurements_view, public.catamidb_deployment 
WHERE public.catamidb_pose.id=public.catamidb_image.id and public.catamidb_pose.id=public.measurements_view.id and public.catamidb_pose.deployment_id=public.catamidb_deployment.id
